import React,{useEffect, useState} from 'react'
import {View,Text,Image,ScrollView, TextInput,
        KeyboardAvoidingView,Platform,Button} from 'react-native'
import { RectButton} from 'react-native-gesture-handler'
import styles from "./styles";
import { useNavigation } from '@react-navigation/native';
//API
import userService from '../../Services/apiServices/api';
import DropDownPicker from 'react-native-dropdown-picker';
import Messages from '../../utils/Messages';

import { Vehicle } from '../../models/Vehicle';
import { VehicleTypes } from '../../models/VehicleTypes';

export default function Register() {

  const keyboardVerticalOffset = Platform.OS === 'ios' ? -50 : 0
  const behavior = Platform.OS === 'ios' ? "position" : 'position'
  const navigation = useNavigation()

  const [vehicle,setVehicle] = useState<Vehicle>({
    vehicleType:'',
    yearManufacture:'',
    color:'',
    license: '',
    mileage: 0
  });


  const [open, setOpen] = useState(false);
  const [value, setValue] = useState("CARRO");
  const [items, setItems] = useState(VehicleTypes);
  const [openYear, setOpenYear] = useState(false);
  const [initialYear, setInitialYear] = useState('');
  const [years, setYears] = useState([{value: 0,label: 0}]);

  const [datePicker, setDatePicker] = useState(false);
  const [date, setDate] = useState(new Date());
 

  useEffect(()=>{
    setYears(getOptions())
  },[])

  function getOptions() {
    var arrayYears  = [];
    var array=[];
    for (let i = 0; i < 5; i++) {
     arrayYears.push(new Date().getFullYear() - i);
   }
     for (let valor of arrayYears) {
       array.push({
          value: valor,
          label: valor
         })  
      }
      return array;
  }
  
  const handleOnPressSend=async()=>{
    console.log(vehicle.yearManufacture)
return
    if(checkInputs()===false){
      return
    }
    const data={
      vehicleType:vehicle.vehicleType,
      yearManufacture:vehicle.yearManufacture,
      color:vehicle.color,
      license:vehicle.license,
      mileage:vehicle.mileage,
    }

    try{  
        await userService.saveUser(data);
        Messages("Usuário salvo. ",'success', 'top') ;
        navigation.navigate('Login') 
    }
    catch(error: any)  {
      if(error.status===403){
        Messages("Erro:"+error,'danger', 'top') ;
      }else if(error.status===403){
        Messages("Erro: "+error,'danger', 'top') ;
      }else{
        Messages("Usuário não pode ser salvo. ",'danger', 'top') ;
      }
    }
  }

  const handleOnPressRegister=()=>{
    navigation.navigate('Register') 
  }

  const checkInputs=()=>{

     if(value===null || value===undefined){
      Messages('Informe o tipo de veículo. ', 'warning', 'top')
      return false;
     }
     if(vehicle?.yearManufacture===undefined || vehicle?.yearManufacture===""){
       Messages('Informe o ano. ', 'warning', 'top')
       return false;
     }
     if(vehicle?.color===undefined || vehicle?.color===""){
      Messages('Informe a cor. ', 'warning', 'top')
      return false;
     }
     if(vehicle?.license===undefined || vehicle?.license===""){
      Messages('Informe a placa. ', 'warning', 'top')
      return false;
     }
     if(vehicle?.mileage===undefined || vehicle?.mileage===0){
      Messages('Informe a quilometragem. ', 'warning', 'top')
      return false;
     }
     return true;
 }

  function onDateSelected(event:any, value:any) {

   setDate(value);
   setVehicle({...vehicle,yearManufacture:value.dateString})
   setDatePicker(false);
 }

 return (
  <>
    <View style={styles.container} >
        <Image style={styles.image_login} source={require('../../assets/deliveryman.png')}/>
        <Text style={styles.title}>Faça o Cadastro do seu Veículo</Text>
        <KeyboardAvoidingView
          style={{ flex:1 }}
          behavior={behavior}
          keyboardVerticalOffset={keyboardVerticalOffset}
        >
           <View style={styles.content}>
          
              <DropDownPicker
                style={styles.dropDownPicker}
                open={open}
                value={value}
                items={items.vehicleType}
                setOpen={setOpen}
                setValue={setValue}
                setItems={(value) => setItems({vehicleType:[]})}
              />
              
              <DropDownPicker
              style={styles.dropDownPicker}
              open={openYear}
              value={initialYear}
              items={years}
              setOpen={setOpenYear}
              setValue={setYears}
              setItems={(value) => setYears(value)}
            />
        
              <ScrollView style={{flex:1,marginTop:20}}
                keyboardShouldPersistTaps='handled'
                showsVerticalScrollIndicator={false}
              >   
                 
                  <TextInput style={styles.text_Input}
                    placeholder="Cor principal"
                    onChangeText={(value) => setVehicle({...vehicle,color:value})}
                    keyboardType={'default'}
                    maxLength={20}
                  />
                  <TextInput style={styles.text_Input}
                    placeholder="Placa"
                    onChangeText={(value) => setVehicle({...vehicle,license:value})}
                    keyboardType={'default'}
                    maxLength={8}
                  />
                  <TextInput style={styles.text_Input}
                    placeholder="Quilometragem atual"
                    onChangeText={(value) => setVehicle({...vehicle,mileage:value})}
                    keyboardType={'numbers-and-punctuation'}
                    maxLength={6}
                  />
              </ScrollView>
           </View>
           <View style={styles.footer}>
              <RectButton 
                style={styles.button}
                onPress={handleOnPressSend}
              >
                <Text style={styles.buttonText}>ENVIAR</Text>
              </RectButton>   
           </View>
        </KeyboardAvoidingView>
    </View>
  </>
);
}
